function Input(props) {
  const { labelName, labelClass, labelSpan, spanClass, nameInput, typeInput, inputId, inputValue, placeholderInput, checked } = props;
  console.log(checked);
  return (
    <label
      className={labelClass}
    >
      {labelName}
      <span className={spanClass}>{labelSpan}</span>
      <input
        checked={checked}
        type={typeInput}
        name={nameInput}
        id={inputId}
        value={inputValue}
        placeholder={placeholderInput}
      />
    </label>
  );
}

export default Input;
